import LForm from '../components/LForm'


import diskJockey from '../images/onesandtwos.jpg'

const styles = {
    Center: {
      textAlign: 'center',
      justifyContent: 'center',
      alignItems: 'center',
      borderStyle: 'solid',
      borderRadius: '5px'
    },
    Disk:{
      borderStyle: 'solid',
      borderRadius: '5px'
    }
  }

  export default function Login() {
    return (
        <div style={styles.Center}>

            <img src={diskJockey} alt="dj" style={styles.Disk}/>
            <row>
            THIS IS A TEST
            </row>
            <LForm/>
        </div>
    )};
